// Constructor
FiveBarFunctions::FiveBarFunctions(double a, double b, double c, double d, double f, double SL)
{
	FBar_Init(a,b,c,d,f,SL);
}

// Overloaded constructor with a neutral position. This position can be seen as the initial/neutral 
// configuration of the fivebar mechanism
FiveBarFunctions::FiveBarFunctions(double a, double b, double c, double d, double f, double SL, double theta2_Init, double theta5_Init)
{
	FBar_Init(a,b,c,d,f,SL);
	
	_t2_Neutral = theta2_Init;
	_t5_Neutral = theta5_Init;
}

void FiveBarFunctions::FBar_Init(double a, double b, double c, double d, double f, double SL)
{
  _a = a;
  _b = b;
  _c = c;
  _d = d;
  _f = f;
  _SL = SL;
  
  _a_sqrd = _a*_a;
  _b_sqrd = _b*_b;
  _c_sqrd = _c*_c;
  _d_sqrd = _d*_d;
  _f_sqrd = _f*_f;
  
  _b_twoTimes = 2*_b;
  _c_twoTimes = 2*_c;
  _d_twoTimes = 2*_d;
  _ad_twoTimes = 2*_a*_d;
  _af_twoTimes = 2*_a*_f;
  
  _K1 = _a_sqrd - _b_sqrd + _c_sqrd + _d_sqrd + _f_sqrd;
  _K2 = _a_sqrd + _b_sqrd - _c_sqrd + _d_sqrd + _f_sqrd;	
  
  
  // Init trigonometric values
  _pi = 3.14159265359;	
  _twopi = 2*_pi;
  _threeOverTwopi = 3/2*_pi; 
  _piOverTwo = _pi/2;
  _piOverFour = _pi/4;  

}

// Jacobian of the fivebar
double FiveBarFunctions::FBar_Jacobian(double theta2_IN, double theta5_IN, double theta3_IN, double theta4_IN, double *J)
{
	double denominator;
    denominator = _b*(cos(theta3_IN-2*theta4_IN)-cos(theta3_IN));

    J[0] = -_a*sin(theta2_IN) + (2*sin(theta4_IN)*_a*sin(theta2_IN-theta4_IN)*_b*sin(theta3_IN))/denominator;
	J[1] = (2*sin(theta4_IN)*_d*sin(theta4_IN-theta5_IN)*_b*sin(theta3_IN))/denominator;
	J[2] = _a*cos(theta2_IN) - (2*sin(theta4_IN)*_a*sin(theta2_IN-theta4_IN)*_b*cos(theta3_IN))/denominator;
	J[3] = -(2*sin(theta4_IN)*_d*sin(theta4_IN-theta5_IN)*_b*cos(theta3_IN))/denominator;
	
	return denominator;
}

// Optimized Jacobian. Faster implementation of jacobian that should be called right after output angles function.
// It regenrates sine and cos values of fivebar angles from memory.
double FiveBarFunctions::FBar_JacobianOptimized(double theta3_IN, double theta4_IN, double *J)
{
	double denominator;
	
	double s_t2_min_t4 = _s_t2*_c_t4 - _c_t2*_s_t4;
	double s_t4_min_t5 = _s_t4*_c_t5 - _c_t4*_s_t5;
	//double opt_termA = 2*_s_t4*_a*s_t2_min_t4*_b;
	//double opt_termB = 2*_s_t4*_d*s_t4_min_t5*_b;
	double opt_term0 = 2*_s_t4*_a*s_t2_min_t4*(_b+_SL)*_s_t3;
	double opt_term1 = 2*_s_t4*_a*s_t2_min_t4*(_b+_SL)*_c_t3;
	double opt_term2 = 2*_s_t4*_d*s_t4_min_t5*(_b+_SL)*_s_t3;
	double opt_term3 = 2*_s_t4*_d*s_t4_min_t5*(_b+_SL)*_c_t3;
	
	denominator = _b*(cos(theta3_IN-2*theta4_IN)-_c_t3);

    J[0] = -_a*_s_t2 + opt_term0/denominator;
	J[1] = opt_term2/denominator;
	J[2] = _a*_c_t2 - opt_term1/denominator;
	J[3] = -(opt_term3)/denominator;
	
	_J11 = J[0];
	_J12 = J[1];
	_J21 = J[2];
	_J22 = J[3];	
	
	return denominator;
}

// Compute output angles theta3 and theta4
void FiveBarFunctions::FBar_OutputAngles(int theta2_IN, int theta5_IN, double *result)
{	
	_c_t2 = Math_CosLUT(theta2_IN);
	_c_t5 = Math_CosLUT(theta5_IN);
	_s_t2 = Math_SinLUT(theta2_IN);
	_s_t5 = Math_SinLUT(theta5_IN);

    // Output angle computations
	double A, B, C, D, E, F;
	
	// Comp optimizations
	double term0 = _a*_c_t2;
	//double term1 = _d_twoTimes*(term0 - _f);
	double opt_term0 = _d*_c_t5 - term0 +_f;
	double opt_term1 = _d*_s_t5 - _a*_s_t2;
	double opt_term2 = -(_af_twoTimes*_c_t2 + _d_twoTimes*(term0 - _f)*_c_t5 + _ad_twoTimes*_s_t2*_s_t5);	
	
    A = _c_twoTimes*opt_term0;
    B = _c_twoTimes*opt_term1;
    C = _K1 + opt_term2;
    D = C - A;
    E = B+B;
    F = A + C;

    //theta_4 = 2*atan((-E+sqrt(E*E - 4*D*F)) / (2*D)) ;
	result[1] = 2*Math_fastAtan((-E+sqrt(E*E - 4*D*F)) / (D+D));
	//theta_4 = 2*Math_fastAtan(E*D*F);

	double G, H, K, L, M, N;
    G = -_b_twoTimes*opt_term0;
    H = -_b_twoTimes*opt_term1;
    K = _K2 + opt_term2;
    L = K - G;
    M = H + H;
    N = G + K;

    //result[0] = 2*atan((-M-sqrt(M*M - 4*L*N)) / (2*L));
	result[0]  = 2*Math_fastAtan((-M-sqrt(M*M - 4*L*N)) / (L+L));
	//theta_3 = 2*Math_fastAtan(M*L*N);
	
	//_c_t3 = Math_CosLUT((int)((result[0]/(2.0*_pi))*16384));
	_c_t3 = cos(result[0]);
	_c_t4 = cos(result[1]);
	//_s_t3 = Math_SinLUT((int)((result[0]/(2.0*_pi))*16384));
	_s_t3 = sin(result[0]);
	_s_t4 = sin(result[1]);
}

// Do five bar forward kinematics. Don't use this anymore.
void FiveBarFunctions::FBar_ForwardKinematics(double theta2_IN, double theta5_IN, double theta3_IN, double theta4_IN, int theta2INT_IN, int theta3INT_IN, double *positionList)
{
    // Left Side
	positionList[0] = _a*Math_CosLUT(theta2INT_IN) + _b*Math_CosLUT(theta3INT_IN);
	positionList[1] = _a*Math_SinLUT(theta2INT_IN) + _b*sin(theta3_IN);	
	
	_posX = positionList[0];
	_posY = positionList[1];
}

// Do five bar forward kinematics
void FiveBarFunctions::FBar_ForwardKinematicsOptimized(double *positionList, double t3_IN)
{
    // Left Side
    // Prev tip offset angle  = 0.8029
	positionList[0] = _a*_c_t2 + _b*_c_t3 + _SL*cos(t3_IN-0.7784); // Subtract 46 degrees in [rad]
	positionList[1] = _a*_s_t2 + _b*_s_t3 + _SL*sin(t3_IN-0.7784);
	
	_posX = positionList[0];
	_posY = positionList[1];	
}

// This is the embedded version of inverkinematics. It doesn't run a loop
// since it is run in the control loop at a high frequency of 1000 Hz.
void FiveBarFunctions::FBar_InverseKinematics(double posX_IN, double posY_IN, double theta2_IN, double theta5_IN, int theta2INT_IN, int theta5INT_IN, double *targetTheta)
{
	
	// Initializations
    double theta2_Target, theta5_Target;
	double currentPos[2] = {_posX, _posY};
	double targetPos[2] = {posX_IN, posY_IN};
	double JacobianINV[4] = {_Jinv11, _Jinv12, _Jinv21, _Jinv22};
	double deltaPos[2];	
	double deltaTheta[2];
	double alpha = 0.99;
	
	// Inv Kine code.
	deltaPos[0] = targetPos[0] - currentPos[0]; 
	deltaPos[1] = targetPos[1] - currentPos[1];	

	Math_22x21MatrixMult(&JacobianINV[0], &deltaPos[0], &deltaTheta[0]);
	theta2_Target = theta2_IN + alpha*deltaTheta[0];
	theta5_Target = theta5_IN + alpha*deltaTheta[1];	
	
    targetTheta[0] = theta2_Target;
	targetTheta[1] = theta5_Target;	

}

double FiveBarFunctions::FBar_UpdateMechanism(int theta2INT_IN, int theta5INT_IN)
{
	double res[2];
	double theta3_Angle, theta4_Angle;
	double Jacobian[4];
	double JacobianINV[4];
	double currentPos[2];
	double det;
	
	FBar_OutputAngles(theta2INT_IN, theta5INT_IN, &res[0]);
	theta3_Angle = res[0];
    theta4_Angle = res[1];	
	det = FBar_JacobianOptimized(theta3_Angle, theta4_Angle, &Jacobian[0]);
	//det = FBar_Jacobian(theta2INT_IN*(2.0*3.14159265359/16384.0), theta5INT_IN*(2.0*3.14159265359/16384.0), theta3_Angle, theta4_Angle, &Jacobian[0]);
	Math_Inv2x2Mat(&Jacobian[0], &JacobianINV[0]);
	FBar_ForwardKinematicsOptimized(&currentPos[0], theta3_Angle);
	
	// Save inverse Jac for later use.
	_Jinv11 = JacobianINV[0];
	_Jinv12 = JacobianINV[1];
	_Jinv21 = JacobianINV[2];
	_Jinv22 = JacobianINV[3];	
	
	return det;
}

